import React from 'react';

class LifeCycle extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            todos : null
        }
    }

    componentDidMount() {
        fetch("todo.json")
        .then(response => {
            return response.json()
        })
        .then(response => {
            this.setState({
                todos : response
            })
        });
    }

    componentDidUpdate() {
        alert("I am componentDidUpdate")
    }

    componentWillUnmount() {
        alert("I am componentWillUnmount")
    }

    render() {
        return(
            <div>
                <table>
                    <tr>
                        <th>Count</th>
                        <th>To Do</th>
                        <th>Status</th>
                    </tr>
                </table>
            </div>
        );
    }
}

export default LifeCycle;
